                function newMarker(e){
                    var new_mark = L.marker().setLatLng(e.latlng).addTo(map_bd843b480529c117cf6dcb483160af9d);
                    new_mark.dragging.enable();
                    new_mark.on('dblclick', function(e){ map_bd843b480529c117cf6dcb483160af9d.removeLayer(e.target)})

                       lng = e.latlng.lng.toFixed(4);
                    new_mark.bindPopup("Latitude: " + lat + "<br>Longitude: " + lng );
                    };
